import React from "react";
import ListeCours from "../components/ListeCours";

function Cours() {
  const cours = [
    {
      titre: "Web et base de données",
      discipline: "Informatique",
      placesMax: 20,
      dateDebut: "01-01-2023",
      dateFin: "06-06-2023",
    },
  ];
  return <ListeCours cours={cours} />;
}

export default Cours;
